import re

input = ""

# Using regex, find a substring of characters with exactly 3 capital letters, 
# then 1 small letter, then exactly 3 capital letters
# eg. ABCdEFG

# This will look for 1 small letter, then 3 big letters, then 1 small letter, 
# then 3 big letters, then 1 small letter
# Our answer will be the combination of the middle small letters of all the results
results = re.findall("[a-z][A-Z]{3}[a-z][A-Z]{3}[a-z]", input)

output = ""
for result in results:
    # Get only the small middle letter
    output += result[4:len(result) - 4]

print(output)